import React, { Fragment, useState } from "react";
import { useDispatch } from "react-redux";
import { Link, withRouter } from "react-router-dom";
import { addExperience } from "../../actions/profile";

const AddExperience = ({ history }) => {
  const [formData, setFormData] = useState({
    company: "",
    title: "",
    location: "",
    from_date: "",
    to_date: "",
    current: false,
    description: ""
  });
  const [toDateDisabled, toggleDisabled] = useState(false);

  const dispatch = useDispatch();

  const {
    company,
    title,
    location,
    from_date,
    to_date,
    current,
    description
  } = formData;

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onSubmit = e => {
    e.preventDefault();
    dispatch(addExperience(formData, history));
  };

  return (
    <Fragment>
      <h1 className="text-3xl font-semibold text-white mb-4">Add An Experience</h1>
      <p className="text-gray-400 mb-4">
        <i className="fas fa-code-branch"></i> Add any developer/programming positions that you have had in the past
      </p>
      <small className="text-gray-500 mb-4">* = required field</small>
      <form className="bg-gray-800 p-6 rounded-lg shadow-md" onSubmit={onSubmit}>
        <div className="form-group mb-4">
          <input
            type="text"
            placeholder="* Job Title"
            name="title"
            value={title}
            onChange={onChange}
            required
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          />
        </div>
        <div className="form-group mb-4">
          <input
            type="text"
            placeholder="* Company"
            name="company"
            value={company}
            onChange={onChange}
            required
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          />
        </div>
        <div className="form-group mb-4">
          <input
            type="text"
            placeholder="Location"
            name="location"
            value={location}
            onChange={onChange}
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          />
        </div>
        <div className="form-group mb-4">
          <h4 className="text-gray-300">From Date</h4>
          <input
            type="date"
            name="from_date"
            value={from_date}
            onChange={onChange}
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          />
        </div>
        <div className="form-group mb-4">
          <p className="text-gray-300">
            <input
              type="checkbox"
              name="current"
              checked={current}
              onChange={e => {
                setFormData({ ...formData, current: !current });
                toggleDisabled(!toDateDisabled);
              }}
              className="mr-2"
            />
            Current Job
          </p>
        </div>
        <div className="form-group mb-4">
          <h4 className="text-gray-300">To Date</h4>
          <input
            type="date"
            name="to_date"
            value={to_date}
            onChange={onChange}
            disabled={toDateDisabled ? "disabled" : ""}
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          />
        </div>
        <div className="form-group mb-4">
          <textarea
            name="description"
            cols="30"
            rows="5"
            placeholder="Job Description"
            value={description}
            onChange={onChange}
            className="bg-gray-900 text-white border border-gray-700 p-2 rounded-lg w-full"
          ></textarea>
        </div>
        <div className="flex gap-x-4 mt-4">
          <input
            type="submit"
            value="Submit"
            className="bg-gray-700 text-white p-2 rounded-lg shadow-sm hover:bg-gray-600 transition duration-300 w-full md:w-auto"
          />
          <Link
            className="bg-gray-600 text-white p-2 rounded-lg shadow-sm hover:bg-gray-500 transition duration-300 ml-4 w-full md:w-auto block text-center"
            to="/dashboard"
          >
            Go Back
          </Link>
        </div>
      </form>
    </Fragment>
  );
};

export default withRouter(AddExperience);
